
@profile        
def longestPalindrome( s: str) -> str:
    max_string = ''
    length = len(s)
    max_string_length = len(max_string)
    for i in range(0,length):
        if (length-i)<= max_string_length:
            break
        for j in range(length,max_string_length,-1):
            left = s[i:j]
            right = left[::-1]

            if left == right:
                if len(s[i:j]) > max_string_length:
                    max_string = s[i:j]
                    max_string_length = len(max_string)
                    break
    return max_string


if __name__ == '__main__':
    print (longestPalindrome(""))
